import React from 'react';
import './Hero.css'; // Import CSS file for styling

const Hero = () => {
    return (
        <div className="image-with-text-overlay">
            <img src="./src/assets/confidence.jpeg" alt="Background" className="background-image" />
            <div className="overlay-text">
                <h1>Text Overlay</h1>
                <p>This is some text overlaid on the image.</p>
            </div>
        </div>
    );
}

export default Hero;
